import React from 'react';


export function Testimonio(){
  return(
    <div className='contenedor-testimonio'>
      <img 
      className='imagen-testimonio'
      src={require('../imagenes/irisdom.png')}
      alt='foto de Iris' />
      <div className='contenedor-texto-testimonio'>
        <p className='nombre-testimonio'>Iris Dominguez</p>
        <p className='cargo-testimonio'>Traductora</p>
        <p className='texto-testimonio'>Traductora profesional</p>
      </div>
    </div>
  
  );
}
